import React from "react";

const App = () => {
  return (
    <>
      <div className="main_div">
        <br />
        <div className="main">
          <h1>ToDo List</h1>
        </div>
        <input type="text" placeholder="Enter your list" />
      </div>
    </>
  );
};

export default App;
